description:
These eleven books published from 1956 to 1960 are the complete run of Spin and Marty published by Dell comics.  These are all nice quality scans about 1000 pixels wide.  All of these books are complete cover to cover scans but there are no advertising pages.  Dell simply didn&amp;#039;t sell advertising in them.  Out of eleven books the only part close to an ad is the bottom 1/3 of book 2 page 34 which is an ad for a different Dell comic book.  Out of 396 pages!  Content cover to cover.  Hard to believe in this day and age.  This is a wonderful and nostalgic collection of memories from days gone by.
